import React, { useState } from 'react';
import { Divider, Steps, Button, Space } from 'antd';
import ListWapper from "../common/ListWapper";
import { useIntl } from 'react-intl';
import { AiFillEdit } from "react-icons/ai";
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate } from "react-router-dom";
import { getProfile } from '../../store/AuthRedux'




const Registration = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch()
  const { messages } = useIntl()

  const [current, setCurrent] = useState(0);
  const onChange = (value) => {
    console.log('onChange:', current);
    setCurrent(value);
  };
  const description = 'This is a description.';

  return (
    <ListWapper>
      <div className='participation'>
        <h3>REGISTRATION</h3>
        <h3> Welcome to our easy 3 step registration!</h3>

        <Steps
          current={current}
          onChange={onChange}
          items={[
            {
              title: 'Step 1',
              description,
            },
            {
              title: 'Step 2',
              description,
            },
            {
              title: 'Step 3',
              description,
            },
          ]}
        />

        <Divider />

        <Steps
          current={current}
          onChange={onChange}
          direction="vertical"
          items={[
            {
              title: 'Step 1',
              description,
            },
            {
              title: 'Step 2',
              description,
            },
            {
              title: 'Step 3',
              description,
            },
          ]}
        />

<Card className='login-card login-card-lg'>
            <AppRowContainer>
              <Col xs={24} lg={12}>
                <div className='login-styled-img mln'>
                  <Logo />
                </div>
              </Col>

              <Col xs={24} lg={12}>
                <div className='login-card-header'>
                  <h3>
                    <IntlMessages id='common.signup' />
                  </h3>
                </div>

                <Form
                  className='login-form'
                  name='basic'
                  initialValues={{ remember: true }}
                  onFinish={onFinish}
                >
                  <Form.Item
                    name='name'
                    className='form-field'
                    rules={[
                      { required: true, message: 'Please input your Name!' },
                    ]}>
                    <Input placeholder={messages['common.name']} />
                  </Form.Item>

                  <Form.Item
                    name='email'
                    className='form-field'
                    rules={[
                      { required: true, message: 'Please input your Email!' },
                    ]}>
                    <Input placeholder={messages['common.email']} />
                  </Form.Item>

                  <Form.Item
                    name='password'
                    className='form-field'
                    rules={[
                      { required: true, message: 'Please input your Password!' },
                    ]}>
                    <Input
                      type='password'
                      placeholder={messages['common.password']}
                    />
                  </Form.Item>

                  <Form.Item
                    name='confirmPassword'
                    className='form-field'
                    rules={[
                      {
                        required: true,
                        message: 'Please input your Retype Password!',
                      },
                    ]}>
                    <Input
                      type='password'
                      placeholder={messages['common.retypePassword']}
                    />
                  </Form.Item>

                  <Form.Item
                    className='login-field-action login-field-action-row'
                    name='remember'
                    valuePropName='checked'>
                    <>
                      <Checkbox>
                        <IntlMessages id='common.iAgreeTo' />
                      </Checkbox>
                      <Link to='/terms' className='login-field-action-link'>
                        <IntlMessages id='common.termConditions' />
                      </Link>
                    </>
                  </Form.Item>

                  <Button
                    type='primary'
                    className='login-form-btn'
                    htmlType='submit'>
                    <IntlMessages id='common.signup' />
                  </Button>
                </Form>

                <div className='login-card-footer'>
                  <span>
                    <IntlMessages id='common.alreadyHaveAccount' />
                  </span>
                  <Link to='/signin' className='login-card-footer-link'>
                    <IntlMessages id='common.signInHere' />
                  </Link>
                </div>
              </Col>
            </AppRowContainer>
          </Card>


        <h3>Are you currently teaching ?</h3>

        <Space className='button-sec'>
          <Button type="primary">Yes</Button>
          <Button>No</Button>

        </Space>

      </div>



    </ListWapper>
  );
};


export default Registration;
